import React from 'react'

class DisplayList extends React.Component {
    render() {
        return (
            <div>
                {this.props.list.map(item => <li key={item.id}>{item.name}, {item.size}</li>)}
                <Button variant="primary">Primary</Button>{' '}
            </div>
        )
    }
}

export default DisplayList
